import React, { Component } from 'react';
import {BrowserRouter as Router, Route, Link, Switch} from 'react-router-dom';
import { SecureRoute, ImplicitCallback } from '@okta/okta-react';
import './dashboard.css';
import Header from './header';
import Main from "./main";
import AddDocument from './addDocument';
import AddVitals from './addVitals';
import FileManagement from './fileManagement';
import Contact from "./contact";
import Navigation from './shared/navigation';
import RegistrationForm from '../auth/components/registration-form';
import config from '../app.config';
import LoginPage from '../auth/components/registration-page';
// import ProfilePage from '../auth/profilePage';

export default class Dashboard extends Component {
  render() {
    return (
      <Router>
        <div className="dashboard">
          <Header />
            <main>
                <Switch>
                  <Route exact path="/" component={Main}/>
                  <Route path="/AddDocument" component={AddDocument}/>
                  <Route path="/AddVitals" component={AddVitals}/>
                  <Route path="/FileManagement" component={FileManagement}/>
                  <Route path="/Contact" component={Contact}/>
                  <Route path="/login" render={() => <LoginPage baseUrl={config.url} />} />
                  {/* <Route path="/implicit/callback" component={ImplicitCallback} /> */}
                  <Route path="/register" component={RegistrationForm} />
                  {/* <SecureRoute path="/profile" component={ProfilePage} /> */}
                </Switch>
            </main>
        </div>
      </Router>
    );
  }
}
